import { AST } from "eslint";
import React from "react";
import * as S from "./styled";
import { FiPlus } from "react-icons/fi";
import profile from "../../assets/profile.jpg";

export type CardProps = {
  profile_image?: string;
  nickName: string;
  text_post: string;
  title: string;
};

const CardPost: React.FC<CardProps> = ({
  nickName,
  profile_image,
  text_post,
  title,
}) => {
  return (
    <S.Wrapper>
      <img src={profile} alt="" />
      <S.ContainerText>
        <S.ProfileName>
          <h3>{nickName} </h3>
        </S.ProfileName>
        <h1>{title} </h1>
        <p>{text_post} </p>

        <button>
          {" "}
          <FiPlus />{" "}
        </button>
      </S.ContainerText>
    </S.Wrapper>
  );
};

export default CardPost;
